(ns solitary-aurora
  (:require [gorilla-plot.core :as plot]
            [witan.send.validate :refer :all]
            [gg4clj.core :as gg4clj]
            [clojure.string :as str]
            [witan.send.utils :as u]
            [kixi.stats.random :as r]
            [witan.send.params :as p]
            [witan.send.states :as s]
            [incanter.stats :as stat]
            [witan.send.test-utils :as tu]
            [witan.send.schemas :as sc]
            [schema.core :as schema]
            [clojure.core.matrix.dataset :as ds])
  (:import [org.HdrHistogram DoubleHistogram]))

(defn seq-of-maps->data-frame
  [coll]
  (when-let [x (first coll)]
    (let [ks (keys x)
          f (apply juxt ks)]
      (zipmap ks (apply map vector (map f coll))))))

(def setting->group
  (hash-map :OOE "Other"
:MMSIB "Mainstream"
:MU "Other"
:MMSOB "Mainstream"
:MSSOB "Special"
:EO "Other"
:EYS "Mainstream"
:MMSIB "Mainstream"
:MMSOB "Mainstream"
:MAP "Other"
:MSS "Special"
:FEC "Further education"
:IMS "Mainstream"
:ISS "Special"
:ISSR "Special"
:MMSIB "Mainstream"
:MU "Other"
:MMSOB "Mainstream"
:MUOB "Other"
:MMS "Mainstream"
:MSSIB "Special"
:MSSOP "Special"
:MSSR "Special"
:MSSOB "Special"
:NMSS "Special"
:NMSSR "Special"
:MAP "Other"
:FEC "Further education"
:FEC "Further education"
:EO "Other"
:NON-SEND "Other"))

